#exit;
for (my $i = 0; $i < $n; $i++){
    chomp(my $word = <STDIN>);
    given ($word){
        when ($_ ~~ /east|west|north|south/i) {say "place"}
        when ($_ ~~ /africa|asia|america|euro/i) {say "place"}
        when ($_ ~~ /burg/i) {say "place"}
        when (@names ~~ /$_/i) {say "person"}
        when (@places ~~ /$_/i) {say "place"}
        default {say "person"}
    }
}
